import styled from "styled-components";

export const Container = styled.div`
    min-height: 100vh;
    height: 100%;
    background-color: var(--primary);
    overflow: hidden;
`;
export const Wrapper = styled.img`
    position: relative;
    z-index: 2;
    width: 100%;
    height: 200%;
    border: 2px solid red;
`;
